import React from "react";
import Navbar from "./Navbar";
import { BrowserRouter as Router, Link } from "react-router-dom";
import ('./Experience.css');

function Experience(){
    return (
        <div>
            <Navbar/>
            <div className="Experience">
                            <h1>Experiences</h1>
            </div>
            <div className="timeline">
                <ul>
                    <li>
                        <div className="2023">
                            <h1>Experiences</h1>
                        </div>
                    </li>
                </ul>
            </div>
        </div>
    );
}

export default Experience;
